import React, { Component } from 'react';
import { AppBar, Toolbar } from "@material-ui/core";

class Header extends Component {

    displayDesktop() {
        <Toolbar>KDB Studio</Toolbar>
    }

    render() {
        return (
            <header>
                <AppBar>
                    {this.displayDesktop}
                </AppBar>
            </header>
        );
    }
}

export default Header;
